import Header from '../includes/header';
import Head from 'next/head';

const MainLayout = (props) => (
    <>
    <Head>
        <title>My awesome App</title>
        <link href="#" rel="stylesheet" />
    </Head>


    <Header/>
        {props.children}
    </>
)

export default MainLayout;
